import React, { Fragment } from 'react'

import Landing from "../components/home/Landing";
import Bio from "../components/home/Bio";
import Menus from "../components/home/Menus";
import Booking from "../components/home/Booking";

const Home: React.FC = () => {
  return (
    <Fragment>
        <Landing />
        <Bio />
        <Menus />
        <Booking />
    </Fragment>
  )
}

export default Home;
